module.exports = function(sequelize, Sequelize) {
 
    var Utilisateur = sequelize.define('utilisateur', {
 
        idUtilisateur: {
            autoIncrement: true,
            primaryKey: true,
            type: Sequelize.INTEGER
        },
 
        nomUtilisateur: {
            type: Sequelize.STRING,
            notEmpty: true
        },
 
        prenomUtilisateur: {
            type: Sequelize.STRING,
            notEmpty: true
        },
 
        photoUtilisateur: {
            type: Sequelize.TEXT,
            defaultValue: 'data:image/png;base64,'
        },
 
        emailUtilisateur: {
            type: Sequelize.STRING,
            allowNull: false,
            validate: {
                isEmail: true
            }
        },
 
        passwordUtilisateur: {
            type: Sequelize.STRING,
            allowNull: false
        }, 
 
    });

    Utilisateur.associate = function(models) {
        models.utilisateur.hasMany(models.recette);
    };
 
    return Utilisateur;
 
}